export function getCookie(n){const t=n+"=",r=decodeURIComponent(document.cookie),i=r.split(";");for(let n=0;n<i.length;n++){let r=i[n];while(r.charAt(0)===" ")r=r.substring(1);if(r.indexOf(t)===0)return r.substring(t.length,r.length)}return""}export function deleteCookie(n){document.cookie=n+"=; expires=Thu, 01 Jan 1970 00:00:00 UTC; path=/;"}